int cursorX, cursorY;
int currentColor = RED, currentTool = PENCIL, currentShape = SQUARE;

static int workingSketch[MAX_Y][MAX_X];
static int Cursor[MAX_CURSOR_MATRIX][MAX_CURSOR_MATRIX];


void pencil(int size, int shape) {
	paintSketchArea(cursorX, cursorY, shape, size, currentColor);
}

void homeScreen() {
	for (int i = 0; i < MAX_Y; i++) {
		for (int j = 0; j < MAX_X; j++) {
			printPixel(i, j, (((homeAndChromatic[i][j]) >> 16) & 0x0000FFFF));
		}
	}
}

void paintSketchArea(int x, int y, int shape, int size, int color) {
	int i = 0;
	int j = 0;
	int t_pos_x = x;
	int t_pos_y = y;

	if (shape == SQUARE) {
		for (i = 0; i < 2 * size; i++) {
			for (j = 0; j < 2 * size; j++) {
				t_pos_y = (y - size) + i;
				t_pos_x = (x - size) + j;
				if (pix_on_screen(t_pos_x, t_pos_y)) {
					workingSketch[t_pos_y][t_pos_x] = color;
				}
			}
		}
	}

	if (shape == POINT) {
		if (pix_on_screen(x, y)) {
			workingSketch[y][x] = color;
		}
	}

	if (shape == DIAGONAL) {
		for (i = 0; i < 2 * size; i++) {
			t_pos_y = (y - size) + i;
			t_pos_x = (x - size) + j;
			if (pix_on_screen(t_pos_x, t_pos_y)) {
				workingSketch[t_pos_y][t_pos_x] = color;
			}
			j++;
		}
	}


	if (shape == CROSS) {
		for (i = 0; i < 2 * size; i++) {
			t_pos_y = (y - size) + i;
			t_pos_x = (x - size) + j;
			if (pix_on_screen(t_pos_x, t_pos_y)) {
				workingSketch[t_pos_y][t_pos_x] = color;
			}
			j++;
		}

		for (i = 0; i < 2 * size; i++) {
			t_pos_y = (y - size) + i;
			t_pos_x = (x - size) + j;
			if (pix_on_screen(t_pos_x, t_pos_y)) {
				workingSketch[t_pos_y][t_pos_x] = color;
			}
			j--;
		}

	}
}

void paintAllBackground(int color) {
	for (int i = 0; i < MAX_Y; i++) {
		for (int j = 0; j < MAX_X; j++) {
			workingSketch[i][j] = color;
		}
	}
}

int pix_on_screen(int x, int y) {
	return (isXonScreen(x) && isYonScreen(y));
}

int isXonScreen(int x) {
	return (!((x < 0) || (x > (MAX_X - 1))));
}
int isYonScreen(int y) {
	return (!((y < 0) || (y > (MAX_Y - 1))));
}


void clearSketch(int color) {
	for (int i = 0; i < MAX_Y; i++) {
		for (int j = 0; j < MAX_X; j++) {
			workingSketch[i][j] = color;
		}
	}
}

void initOledBitmap() {
	MemoryWrite(OLED_MUX, OLED_MUX_BITMAP);
	MemoryWrite(OLED_BITMAP_RST, 1); // Reset the oled_rgb PMOD
}

//Function used to color a pixel at a given position (row, col)
void printPixel(char row, char col, int color) {
	int buff = color;
	buff = (buff << 8) | row;
	buff = (buff << 8) | col;

	MemoryWrite(OLED_BITMAP_RW, buff);
}

void initSketch() {
	for (int i = 0; i < MAX_Y; i++) {
		for (int j = 0; j < MAX_X; j++) {
			workingSketch[i][j] = WHITE;
		}
	}
}

void displaySketch() {
	for (int i = 0; i < MAX_Y; i++) {
		for (int j = 0; j < MAX_X; j++) {
			printPixelAndCursor(i, j, workingSketch[i][j]);
		}
	}
}

void displayChromaticScaleColors() {
	currentColor = WHITE ;
	for (int i = 0; i < MAX_Y; i++) {
		for (int j = 0; j < MAX_X; j++) {
			printPixelAndCursor(i, j, ((homeAndChromatic[i][j]) & 0x0000FFFF));
		}
	}
}

// Pour éviter les clignotements du curseur, on l'affiche en brut
// directement dans cette fonction, et pas après avoir affiché le tableau.
void printPixelAndCursor(char i, char j, int color) {

	if (!isInCursorZone(j, i)) // Inversé, c'est normal
		printPixel(i, j, color);
	else
		printPixel(i, j, currentColor);

}

// Utiliser cette fonction pour tester le tableau de curseur par rapport à la position centrale de ce dernier
int isInCursorZone(char x, char y) {

	// Test du dépassement de la matrix du curseur en X
	if((x<(cursorX-CURSOR_CENTER)) || x>(cursorX+CURSOR_CENTER))
		return 0;

	// Test du dépassement de la matrix du curseur en Y
	if( (y<(cursorY-CURSOR_CENTER)) || y>(cursorY+CURSOR_CENTER))
		return 0;

	// Calcul du position du pointeur matrix par rapport à x/y et par rapport à la position du curseur
	int posX = x - cursorX + CURSOR_CENTER;
	int posY = y - cursorY + CURSOR_CENTER;

	// Test par rapport à la matrix du curseur
	if(Cursor[posX][posY])
		return 1;
	else
		return 0;

}

// On se base directement sur les cordonnées du curseur vérifiées
void updateCursor(int x, int y) {

	// NB: On vérifie X et Y à part, pour éviter les problèmes de bords d'écran !
	if (isXonScreen(x)) {
		cursorX = x;
	} else
		cursorX = MAX_X - 1;

	if (isYonScreen(y)) {
		cursorY = y;
	} else
		cursorY = MAX_Y - 1;
}

void updateColor() {
	currentColor = ((homeAndChromatic[cursorY][cursorX]) & 0x0000FFFF);
}

void getColor(){
	currentColor = (workingSketch[cursorY][cursorX]);
}

void eraser(int size) {
	paintSketchArea(cursorX, cursorY, SQUARE, size, WHITE);
}


void updateCursorMatrix(int tool) {
	clearCursorMatrix();
	switch (tool) {

		case SQUARE : // Un carré

			Cursor[CURSOR_CENTER][CURSOR_CENTER] = 1;

			for(int i = -2 ; i<= 2 ; i++){
				for (int j = -2 ; j<=2 ; j++)
					Cursor[CURSOR_CENTER-i][CURSOR_CENTER-j] = 1;
			}


			break; /* optional */

		case POINT  :

			Cursor[CURSOR_CENTER][CURSOR_CENTER] = 1;

			break; /* optional */

		case DIAGONAL  :
			Cursor[CURSOR_CENTER-4][CURSOR_CENTER-4] = 1;
			Cursor[CURSOR_CENTER-3][CURSOR_CENTER-3] = 1;
			Cursor[CURSOR_CENTER-2][CURSOR_CENTER-2] = 1;
			Cursor[CURSOR_CENTER-1][CURSOR_CENTER-1] = 1;
			Cursor[CURSOR_CENTER][CURSOR_CENTER] = 1;
			Cursor[CURSOR_CENTER+1][CURSOR_CENTER+1] = 1;
			Cursor[CURSOR_CENTER+2][CURSOR_CENTER+2] = 1;
			Cursor[CURSOR_CENTER+3][CURSOR_CENTER+3] = 1;
			Cursor[CURSOR_CENTER+4][CURSOR_CENTER+4] = 1;
			break; /* optional */

		case ERASER  :

			for(int i = -2 ; i<= 2 ; i++){
				for (int j = -2 ; j<=2 ; j++)
					Cursor[CURSOR_CENTER-i][CURSOR_CENTER-j] = 1;
			}

			for(int i = -2 ; i<= 2 ; i++){
				for (int j = -2 ; j<=2 ; j++)
					Cursor[CURSOR_CENTER+1-i][CURSOR_CENTER+1-j] = 1;
			}

			for(int i = -2 ; i<= 2 ; i++){
				for (int j = -2 ; j<=2 ; j++)
					Cursor[CURSOR_CENTER+2-i][CURSOR_CENTER+2-j] = 1;
			}

			for(int i = -2 ; i<= 2 ; i++){
				for (int j = -2 ; j<=2 ; j++)
					Cursor[CURSOR_CENTER+3-i][CURSOR_CENTER+3-j] = 1;
			}

			break; /* optional */

		case EYEDROPPER  :

			for(int i = -2 ; i<= 2 ; i++){
				for (int j = -2 ; j<=2 ; j++)
					Cursor[CURSOR_CENTER-i][CURSOR_CENTER-j] = 1;
			}

			Cursor[CURSOR_CENTER][CURSOR_CENTER] = 0;

			Cursor[CURSOR_CENTER+3][CURSOR_CENTER+3] = 1;
			Cursor[CURSOR_CENTER+4][CURSOR_CENTER+4] = 1;
			Cursor[CURSOR_CENTER+5][CURSOR_CENTER+5] = 1;
			Cursor[CURSOR_CENTER+6][CURSOR_CENTER+6] = 1;


			break; /* optional */

		case COLOR_SELECTOR  : // Une grande croix avec un carré au milieu pour voir la couleur

			Cursor[CURSOR_CENTER+1][CURSOR_CENTER] = 1;
			Cursor[CURSOR_CENTER-1][CURSOR_CENTER] = 1;
			Cursor[CURSOR_CENTER][CURSOR_CENTER+1] = 1;
			Cursor[CURSOR_CENTER][CURSOR_CENTER-1] = 1;

			Cursor[CURSOR_CENTER-1][CURSOR_CENTER-1] = 1;
			Cursor[CURSOR_CENTER-2][CURSOR_CENTER-2] = 1;

			Cursor[CURSOR_CENTER-1][CURSOR_CENTER+1] = 1;
			Cursor[CURSOR_CENTER-2][CURSOR_CENTER+2] = 1;

			Cursor[CURSOR_CENTER+1][CURSOR_CENTER-1] = 1;
			Cursor[CURSOR_CENTER+2][CURSOR_CENTER-2] = 1;

			Cursor[CURSOR_CENTER+1][CURSOR_CENTER+1] = 1;
			Cursor[CURSOR_CENTER+2][CURSOR_CENTER+2] = 1;


			break; /* optional */
		default : // Par défaut, une petite croix
			Cursor[CURSOR_CENTER][CURSOR_CENTER] = 1;
			Cursor[CURSOR_CENTER-1][CURSOR_CENTER-1] = 1;
			Cursor[CURSOR_CENTER-1][CURSOR_CENTER+1] = 1;
			Cursor[CURSOR_CENTER+1][CURSOR_CENTER-1] = 1;
			Cursor[CURSOR_CENTER+1][CURSOR_CENTER+1] = 1;

	}

}

void clearCursorMatrix(){
	for(int i=0 ; i<MAX_CURSOR_MATRIX; i++){
		for (int j=0 ; j<MAX_CURSOR_MATRIX; j++){
			Cursor[i][j]=0;
		}
	}
}

void setCurrentColor(int color){
	currentColor = color;
}

void setCurrentTool(int tool){
	currentTool = tool;

	if(currentTool == PENCIL)
		updateCursorMatrix(currentShape);
	else
		updateCursorMatrix(currentTool);

}

int getCurrentTool(){
	return currentTool;
}

void setShape(int shape){
	currentShape = shape;
	updateCursorMatrix(shape);
}

int getShape(){
	return currentShape;
}
